function Header() {
  return (
    <div className="header">
      <div className="hero">
        <div className="hero-details">
          <h1 className="text-3xl font-bold">E-Commerce Website</h1>
          <p>Get all your products here</p>
        </div>
      </div>
    </div>
  );
}

export default Header;
